import React from 'react'
import { Link } from 'react-router-dom'

function Hyperlinks () {
    const style = {
        text: "white"
    };
    
    return (
        <div class="hyperlinks">
            <Link id="up-left" to='/about'>
                about
            </Link>
            <div id="up-right">contact</div>
            <div id="down-left">resume</div>
            <Link id="down-right" to='/.mywork'>my work</Link>
        </div>
    )
}
export default Hyperlinks
